  input: '"TEXT","F3A","C00364349","This amendment is in response to your letter stating
    a concern with the Amended October Quarterly Report (7/1/02-9/30/02), dated 1/8/03
    filed by the Weller for Congress Committee.  In your letter dated April 1, 2003,
    your report indicates that our Column B figures for the Summary and Detailed Summary
    Pages are incorrect.  Please find the amended report correcting those discrepancies.  You
    also indicated that there was a discrepancy in the aggregate election cycle-to-date
    totals.  Please find that these are now corrected due to an amendment to the Mid-Year
    report (1/1/01-3/31/01).  You also indicated that the campaign must attempt to
    obtain the occupations and name of employer for all individuals who contribute
    more than $200 in a calendar year.   We send out a letter within 30 days upon
    receipt of a contribution missing this information.  In this letter we clearly
    ask for the missing information without soliciting a contribution; inform the
    contributor of the requirements of federal law of the reporting of such information;
    and include a pre-addressed envelope.  If information is not received in a timely
    manner we send out a second request for the missing information.  Any information
    that we receive will be amended at a later date or will be a memo item in another
    report.  Please also find that the amended report now shows recognizable political
    committee names.  The committee has taken the necessary steps so this will not
    happen in the future.  If you have any further questions please let us know."'
